import React, { Component } from 'react'
import "./home.css"
import BGImg from "../assets/colorful-powder-explosion-white-background_44314-3537.jpg";

export default class Home extends Component {
  render() {
    return (
        <div className="container">
        <div className="row">
          <div className="col-7">
            <img className="w-100" src={this.state.imgSoure} alt="" />
          </div>
          <div className="col-5">
            <button
              onClick={() => {
                this.carColor(RedCar);
              }}
              className="btn btn-danger"
            >
              Red
            </button>
            <button
              onClick={() => {
                this.carColor(BlackCar);
              }}
              className="btn btn-dark"
            >
              Black
            </button>
            <button
              onClick={() => {
                this.carColor(SteelCar);
              }}
              className="btn btn-secondary"
            >
              Steel
            </button>
            <button
              onClick={() => {
                this.carColor(SilverCar);
              }}
              className="btn btn-light"
            >
              Silver
            </button>
          </div>
        </div>
      </div>
    )
  }
}
